I have always loved to read! And before I had my daughter it would be nothing for me to finish a book in a day or two!

So here is my book suggestion to you! Well two books actually!

The Handmaid's Tale & The Testimate by Margaret Atwood

If you have watched The Handmaid's Tale TV series but have not read the book you are missing out!! And if you read The Handmaids Tale but haven't checked out The Testimate yet, I reccomend that you definitely should.

Is anyone else a book lover? Have you also read these books? Love them? Hate them?

If your not a reader, what would I find you doing with an hour of uninterrupted time?
